import React, { useState } from "react"
import { connect } from "react-redux"
import ReactDataSheet from 'react-datasheet';
import Container from "react-bootstrap/esm/Container";

const Plans = () => {


  const initialGrid = [
      [{value: '', readOnly: true, width: '3rem'}, {value:"Measured Depth", readOnly: true, width: '7rem'}, {value:"Inclination", readOnly: true, width: '7rem'}, {value:"Azimuth", readOnly: true, width: '7rem'}, {value:"TVD", readOnly: true, width: '7rem'}, {value:"Northing", readOnly: true, width: '7rem'}, {value:"Easting", readOnly: true, width: '7rem'}],
      [{value: 1, readOnly: true}, {value: 0, readOnly: true}, {value: 0, readOnly: true}, {value: 0, readOnly: true}, {value: 0, readOnly: true}, {value: 0, readOnly: true}, {value: 0, readOnly: true}],
      []
  ]
  const [grid, setGrid] = useState(initialGrid)
  const valueRenderer = cell => cell.value;
  const onCellsChanged = changes => {
    const grid = grid;
    changes.forEach(({ cell, row, col, value }) => {
      grid[row][col] = { ...grid[row][col], value };
    });
    setGrid(grid)
  };
  const onContextMenu = (e, cell, i, j) =>
  cell.readOnly ? e.preventDefault() : null;


  return (
    <Container>
      <Col xs={10}>
    <ReactDataSheet
        data={grid}
        valueRenderer={valueRenderer}
        onContextMenu={onContextMenu}
        onCellsChanged={onCellsChanged}
    />
    </Col>
    </Container>
  )
}

export default connect(null)(Plans)
